mapper.select:

select 

from TRAMITE.TDTBD_TUPA
where N_NUMGRUPO = #{nNumgrupo,jdbcType=DECIMAL}
  and N_NUMDEP = #{nNumdep,jdbcType=DECIMAL}
  and V_CODTUPA = #{vCodtupa,jdbcType=VARCHAR}

mapper.delete:

delete from TRAMITE.TDTBD_TUPA
where N_NUMGRUPO = #{nNumgrupo,jdbcType=DECIMAL}
  and N_NUMDEP = #{nNumdep,jdbcType=DECIMAL}
  and V_CODTUPA = #{vCodtupa,jdbcType=VARCHAR}
